import React from "react";
import avatar from "../../images/subhan.png";
import ''

const Profile = () => {
  return (
    <div className="profileContainer">
      <div className="details">
        <p>
          Hello, I'm <br />
          SUBHAN SAHEB SHAIK
          <br />A COMPUTER SCIENCE STUDENT
        </p>
      </div>
      <div className="photo">
        <img src={avatar} alt="" />
      </div>
    </div>
  );
};

export default Profile;
